export default function QuizMain() {
    return (
        <section className="quiz">
            <div className="progress-container">
                <progress value="2" max="10"></progress>
            </div>
            <div className="progress-info">
                <span className="question-info">Ques: 2/10</span>
                <p className="points-info">Points: <span>35/70</span></p>
                <span className="timer-info">Time: 03:00</span>
            </div>
        </section>
    );
}
